<div className={classes.SideMainContainer} style={{width:'5rem'}} >


<SideNavBarButton icon={BsSpeedometer} name="Dashboard"/>

<SideNavBarButton icon={BsChatLeftText} name="Messages"/>

<SideNavBarButton icon={GiTeacher} name="Class"/>

<SideNavBarButton icon={BsUiChecksGrid} name="Tasks"/>

<SideNavBarButton icon={BsPencilSquare} name="Exam"/>


<SideNavBarButton icon={BsPeople} name="Classmates"/>	

<SideNavBarButton icon={BsFilePerson} name="Teacher"/>

<SideNavBarButton icon={BsHammer} name="Prepare"/>

<SideNavBarButton icon={BsBook} name="Books"/>

<SideNavBarButton icon={BsGraphUp} name="Progress"/>

<SideNavBarButton icon={BsZoomIn} name="Analytics"/>	

<SideNavBarButton icon={BsTrophy} name="Achievements"/>

<SideNavBarButton icon={BsListOl} name="Goals"/>	

<SideNavBarButton icon={BsCalendarDay} name="Calender"/>


<SideNavBarButton icon={BsJournalText} name="Diary"/>

<SideNavBarButton icon={BsQuestionSquare} name="Help Center"/>


</div>

);




}




export default SideNavBar;
